import Link from 'next/link'

const linkStyle = {
    marginRight: 15
}

const PAGES = [
    { 'Home': '/' },
    { 'About': '/about' },
]

const renderPages = () => (
    PAGES.map(page => renderLink(page))
)

const renderLink = (title, href) => (
    <Link href="/">
        <a style={linkStyle}>Home</a>
    </Link>
)

export default function Header() {
    return (
        <div>
            <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>about</a>
            </Link>
        </div>
    )
}
